import React from 'react';
import { Route, Switch } from 'react-router-dom';

import Pages from '../Pages';

const Routes = () => {
    return(       
        <Switch>
            <Route exact path="/">
                <Pages />
            </Route>
            <Route path="/:page/about">
                <Pages page=""/>
            </Route>
        </Switch>
    );
}

export default Routes;
